import React, { useState } from "react";
const Contact=()=>{
const [data,setData]=useState({
    fulName:'',
    phone:' ',
    email:' ',
    message:' '
})
const inputEvent=(event)=>{
    const {name,value}=event.target
   setData((preVal)=>{
         return{
             ...preVal,
         [name]:value,
        }
   })

}
const formSubmit=()=>{

}
    return(
        <>
         <div className="my-5 mx-auto text-center">
  <h1>Contact Us</h1>
</div>

<div class="container">
<div class="row">
  <div class="col-md-6 col-10 mx-auto">

  <form onSubmit={formSubmit}>
  <div class="form-group">
    <label >Name</label>
    <input type="text" class="form-control" id="Enter Your Name" aria-describedby="emailHelp" name="fulName" value={data.fulName} onChange={inputEvent} placeholder="Enter email" />

  </div>
  <div class="form-group">
    <label >Phone #</label>
    <input type="number" class="form-control" id="exampleInputPassword1" name="phone" value={data.phone} onChange={inputEvent} placeholder="Password" />
  </div>
  <div class="form-group">
    <label >Email address</label>
    <input type="email" class="form-control" aria-describedby="emailHelp" name="email" value={data.email} onChange={inputEvent} placeholder="Enter email"/>
  </div>
  <div class="form-group">
    <label >Message</label>
    <textarea class="form-control" name="message" value={data.message} onChange={inputEvent} id="exampleFormControlTextarea1" rows="3"></textarea>
  </div>
  <button type="submit" class="btn btn-outline-primary mt-2">Submit</button>
</form>
  </div>

</div>
   </div>

        </>
    )
}
export default Contact;
